import React from 'react';
import pc from './MyPosts.module.css'
import Post from "./Post/Post";

const MyPosts = () => {
    return (

        <div className={pc.pp}>
            My posts
            <div>
                <div>
                    <textarea> </textarea>
                </div>
                <div>
                    <button> add post</button>
                </div>
            </div>
            <div>
                <Post message='Hi' likecount='15'/>
                <Post message="It1" likecount='20'/>
            </div>
        </div>
    );
}
export default MyPosts;
